// /pages/resume.js

// import our components
import withLayout from '../components/BaseLayout.js'

// The resume page
const Page = () =>
	<div>
		<p>This is the about page</p>
		<p>Can add more content but it must be within a div tag</p>
		<iframe src="https://open.spotify.com/embed/track/60trfxe04bQSenjIVLdQJ3" width="300" height="380" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
	</div>
	
export default withLayout(Page)
